import './projeto/Styles/global.css'
// import Route from './projeto/Routes/Routes'

import { useState } from 'react-dom'

function App() {

  const[values, setValues] = useState([
    {
      name:'',
      // email:'',
      // message:''
    }
  ])

  function onChange(e){
    setValues({
      ...values,
      [e.target.name] : e.target.value
    })
  }



}


export default App;
